	FLAG_RESPONSE : 2,
	FLAG_LONGPOLL : 2,
	FLAG_TIMEOUT : 4,
	FLAG_LONGPOLL_TIMEOUT : 6,
	BYPS_VERSION_WITH_SESSIONID : 3
