/**
 * </p>
 * <p>Depending on the committed values, different searches are performed:
 * <ul>
 * <li>If <code>roundTo == null</code> and <code>relative == null</code>, a search for the exact current times is performed.
 * <li>If <code>roundTo != null</code> and <code>relative == null</code>, a range query is performed.<br>
 * From is current time rounded down, To is current time rounded up, defined by <code>roundTo</code>.
 * <li>If <code>relative != null</code>: A range query relative to current time is performed.<br>
 * <ul>
 * <li>If the biggest relative value is negative, a range query into the past is performed.<br>
 * <code>From</code> is current time - <code>relative</code>, rounded down if <code>roundTo != null</code>.
 * <code>To</code> is current time, rounded up if <code>roundTo != null</code>.
 * <li>If the biggest relative value is positive, a range query into the future is performed.<br>
 * <code>From</code> is current time, rounded down if <code>roundTo != null</code>.
 * <code>To</code> is current time + <code>relative</code>, rounded to if <code>roundTo != null</code>.
 * </ul>
 * <p>The delivered date is converted to the time zone submitted in ClientInfo</p>
 * </ul>
 * 
 * <p>A time offset to UTC time can be delivered by <code>diffToUtc</code>.<br>
 * {@link SearchFieldE#X_DATE}, {@link SearchFieldE#I_DATE}, {@link SearchFieldE#DELETED_DATE} and
 * {@link SearchFieldE#TIMESTAMP} are converted to UTC prior to saving them, index lines in date format are not converted.<br>
 * Therefore, a timezone should always be commited for these four.</p>
 * @since 11.00.000.019
 * <p>Class to commit a time which refers to the current time.
*/
