// IXConnection
//
///////////////////////////////////////////////////////////////////////////////////////////////////////

/**
 * <p>
 * This class provides the IndexServer interface with a relogin mechanism 
 * in each of the interface functions and supersedes the IXClient class. 
 * An object of this class represents one IndexServer session which is 
 * managed by an IXConnLogin object.
 * </p><p>
 * Instances of this class are usually created by an IXConnFactory object.
 * </p><p>
 * Example:
 * <code>Properties props = IXConnFactory.createConnProps(tp.url, 2, 10 * 60);</code>
 * <code>Properties sessOpts = IXConnFactory.createSessionOptions("MyApp", "1.0", "");</code>
 * <code>connFact = new IXConnFactory(props, sessOpts);</code>
 * <code>IXServicePortC CONST = connFact.getCONST();</code>
 * <code>IXConnection ixConn = connFact.create("Fritz", "geheim", "MYPC", null);</code>
 * <code>EditInfo ed = ixConn.ix.checkoutDoc(docId, null, EditInfoC.mbSordDoc, LockC.NO);</code>
 * <code>...</code>
 * <code>ixConn.logout();</code>
 */
de.elo.ix.client.IXConnection = function(connFact, bclient, auth, url, connProps, sessOpts) {
	
	/**
	 * Connection factory.
	 * Support compatibility to ELO 8.0
	 */
	this._connFact = connFact;
	
	/**
	 * BClient_Indexserver
	 */
	this._bclient = bclient;
	
	/**
	* IXAuthentication  
	*/
	this._auth = auth;
	
	/**
	 * Connection properties. This properties are the same as those that have been
	 * supplied to the IXConnFactory object. 
	 */
	this._connProps = connProps;
	  
	/**
	 * Indexserver API _CONSTANTS
	 */
	var _CONSTANTS  = null;

	/**
	* EventBusApi object.
	*/
	var _eventBusApi = null;

	/**
	* Get IndexServer interface object (IXConnIXServicePortIF)
	*/	
	this.ix = function() {
		return this._bclient.iXServicePortIF;
	};
	
	/**
	 * Get LoginResult
	 */
	this.getLoginResult = function() {
		return this._auth.getLoginResult();
	};

	/**
	 * Get user ID
	 */
	this.getUserId = function() {
		return this.getLoginResult().user.id;
	};
	
	/**
	 * Get user name
	 */
	this.getUserName = function() {
		return this.getLoginResult().user.name;
	};
	
	/**
	 * Get connection properties
	 */
	this.getConnProperties = function() {
		return this._connProps;
	};
	
	/**
	 * Get Indexserver URL
	 */
	this.getEndpointUrl = function() {
		return url;
	};
	
	/**
	 * Get session options
	 */
	this.getSessionOptions = function() {
		return this._auth._sessOpts;
	};
	
  /**
   * Get approved token.
   * Send this token in request header 'ELO-Approved' to a REST plugin operation 
   * that is marked with annotation @Approved.
   * This token should also be available as cookie named 'ELO-Approved'. 
   */
  this.getApprovedToken = function() {
    // EIX-1817: Block CSRF attacks for REST requests.
    return this._bclient.transport.getSessionId();
  };
  
  /**
   * Provides an object to send requests to Indexserver REST plugins.
   */
  this.rest = function() {
    // EIX-1817: Block CSRF attacks for REST requests.
    return new de.elo.ix.client.REST(this);
  }
  
	/**
	 * Returns the error messages from the status page.
	 */
	this.getStatusPageErrors = function() {
		var props = this._connFact._readStatusPageProperty();
		var errs = [];
		for (var key in props) {
			if (key.indexOf("ERROR.") == 0) {
				var val = props[key];
				errs.push(val);
			}
		}
		return errs;
	};
	
	/**
	 * Get the Indexserver version and build number.
	 */
	this.getImplVersion = function() {
		var props = this._connFact._readStatusPageProperty();
		return props["Version"] + "." + props["Build"];
	};
	
	/**
	 * Get the Indexserver version number.
	 */
	this.getVersion = function() {
		var props = this._connFact._readStatusPageProperty();
		return props["Version"];
	};
	
	/**
	 * Get the Indexserver stream version number.
	 */
	this.getStreamVersion = function() {
		var props = this._connFact._readStatusPageProperty();
		return props["StreamVersion"];
	};
	
	/**
	 * Get object with Indexserver API CONSTANTS.
	 */
	this.getCONST = function(asyncResult) {
		if (!this._CONSTANTS) {
			this._CONSTANTS = this.ix().getConstants(asyncResult);
		}
		else if (asyncResult) {
			asyncResult = de.elo.ix.client.makeAsyncResultIfAsyncCallback(asyncResult);
			asyncResult(this._CONSTANTS, null);
		} 
		return this._CONSTANTS;
	};
	
	/**
	 * Convert ISO date into JavaScript Date object
	 */
	this.isoToDate = function(iso) {
		if (!iso) return null;
		var dt = new Date();
		iso = iso.replace(".", "").replace("-", "").replace(" ","");
		if (iso.length >= 4) dt.setUTCFullYear(iso.substr(0, 4));
		if (iso.length >= 6) dt.setUTCMonth(parseInt(iso.substr(4, 2))-1);
		if (iso.length >= 8) dt.setUTCDate(iso.substr(6, 2));
		if (iso.length >= 10) dt.setUTCHours(iso.substr(8, 2));
		if (iso.length >= 12) dt.setUTCMinutes(iso.substr(10, 2));
		if (iso.length >= 14) dt.setUTCSeconds(iso.substr(12, 2));
		if (iso.length > 14) dt.setUTCMilliseconds(iso.substr(14));
		return dt;
	};
	
	/**
	 * Convert a JavaScript Date object to ISO.
	 */
	this.dateToIso = function(date) {
		if (!date) return null;
		function pad(n) {  return n < 10 ? '0'+n : n; };
	    return date.getUTCFullYear()+'-'
		    + pad(date.getUTCMonth()+1)+'-'
		    + pad(date.getUTCDate())+'T'
		    + pad(date.getUTCHours())+':'
		    + pad(date.getUTCMinutes())+':'
		    + pad(date.getUTCSeconds())+'Z';
	};
	
	/**
	 * Logout.
	 */
	this.logout = function(asyncResult) {
		var ret = null;
		var me = this;
		if (!asyncResult && de.elo.ix.client.createPromise) {
			ret = de.elo.ix.client.createPromise(function(resolve, reject) {
				me._internalLogout(function(result, ex) {
					if (ex) reject(ex); else resolve(result);
				});
			});
		}
		else {
			asyncResult = de.elo.ix.client.makeAsyncResultIfAsyncCallback(asyncResult);
			ret = me._internalLogout(asyncResult);
		}
		return ret;
	};

	/**
	 * Close (logout) connection.
	 * Same as logout.
	 */
	this.close = function(asyncResult) {
		return this.logout(asyncResult);
	};

	this._internalLogout = function(asyncResult) {
		var me = this;
		var skipLogout = this.getAuthenticationType() == de.elo.ix.client.EAuthenticationType.FROM_TICKET || 
							this.getAuthenticationType() == de.elo.ix.client.EAuthenticationType.FROM_COOKIE;
			
		try {
		    if (_eventBusApi) {
		        _eventBusApi.done();
		        _eventBusApi = null;
		    }
		    
		    if (asyncResult) {
		    	
		    	if (!skipLogout) {
			    	var outerResult = function(ignored, ex) {
			    		var innerResult = function(ignored, ex) {
			    			asyncResult(ignored, null);
			    		};
					    me._bclient.done(innerResult);
				    }
				    this.ix().logout(outerResult);
		    	}
		    	else {
		    		this._bclient.done(asyncResult);
		    	}
		    }
		    else {
		    	if (!skipLogout) {
		    		this.ix().logout();
		    	}
		    	this._bclient.done();
		    }
		    
		}
		catch (ignored) {}
	};
	
	/**
	 * Get the database engine: MSSQL, ORACLE, DB2.
	 */
	this.getDatabaseEngine = function() {
		return this._serverInfo.databaseEngine;
	};
	
	/**
	 * Encrytps a password used to login or to supply an encryption set password.
	 * @param s Plain text password.
	 * @return Encrypted password.
	 */
	this.encryptPassword = function(s) {
		return this._auth.encryptPassword(s);
	};

	/**
	 * This function builds an URL to upload a file by HTML or AJAX.
	 * When Indexserver has received all file data, it calls the event IXServerEvents.onFileUploadBuildResponse.
	 * Implement this event to build a response according to the file upload solution. 
	 * The response must supply the "uploadResult" generated in the Indexserver. 
	 * It has to be assigned to the uploadResult member of the DocVersion object in order to call checkinDocEnd.      
	 */
	this.makeUploadUrl = function(additionalParams) {
		var url = this.getEndpointUrl();
		url += "?cmd=writedoc&mode=vdef&retjson=true";
		if (additionalParams) {
			if (additionalParams.length && additionalParams.charAt(0) != '&') {
				url += "&";
			}
			url += additionalParams;
		}
		return url;
	};
	
	/**
	 * This function builds an URL to upload a file via FileData.stream.
	 */
	this.makeHtml5UploadUrlForFileDataStream = function(file, additionalParams) {
		var url = this.getEndpointUrl();
		var p = url.lastIndexOf("/ix");
		var uploadUrl = url.substring(0, p) + "/byps?uploadHandler=html5&ticket=" + this.getLoginResult().clientInfo.ticket;
		if (additionalParams) {
			if (additionalParams.length && additionalParams.charAt(0) != '&') {
				uploadUrl += "&";
			}
			uploadUrl += additionalParams;
		}
		return uploadUrl;
	};

    this.getEventBusApi = function () {
        if (!this._eventBusApi) {
        	
        	if (!this._connFact.connProps[connFact.NB_OF_REVERSE_CNNS]) {
        		throw "At least one reverse connection is required for using EventBusApi";
        	}
        	
        	var conn = this;
            conn._eventBusApi = new de.elo.ix.client.EventBusApi(this);
            
            auth.addListener( function(client, e) {
				if (e == null) {
					conn._eventBusApi._onRelogin();
				}
            });
            
            this._bclient.startR();
        }
        return this._eventBusApi;
    };
    
    this.getFeedService = function() {
    	return this._bclient.feedService;
    };

    this.getPluginService = function() {
    	return this._bclient.pluginService;
    };
    
    this.getLdapService = function() {
    	return this._bclient.ldapService;
    };
    
    this.getPluginService = function() {
    	return this._bclient.pluginService;
    };
    
    this.setFeedNotification = function(skeleton) {
        this._bclient.startR();
    	this._bclient.addRemote(skeleton);
    };
    
    this.getBClientUploadUrl = function() {
    	return this._bclient.transport.wire.url;
    };
    
    this.getAuthenticationType = function() {
    	return this._auth._authType;
    };
    
    /**
	 * Replace the currently activated functional roles.
	 * @param roleIds IDs of roles to activate.
	 * @param asyncResult Asynchronous result object, optional
	 * @return LoginResult object with updated permissions and group membership. 
	 * @since 20.00.000.003
     */
    this.activateRoles = function(roleIds, asyncResult) {
    	
    	asyncResult = de.elo.ix.client.makeAsyncResultIfAsyncCallback(asyncResult); 
    	
    	var me = this;
    	var ACTIVE_ROLES = me.getCONST().SESSION_OPTIONS.ACTIVE_ROLES;
    	var sessOpts = me.getSessionOptions();
    	var roleIdsStr = roleIds.join(",");
    	
        // Activate roles in session options.
        sessOpts[ACTIVE_ROLES] = roleIdsStr;
        var opts = me._auth._makeSessOptsObj();
        
        var ret = null;

        // Use promise objects?
        if (!asyncResult && de.elo.ix.client.createPromise) {
    		ret = me.ix().setSessionOptions(opts).then(function() {
    			return me.refreshLoginResult();
    		});
 		}
        else {
        	
        	// Asynchronous call?
		    if (asyncResult) {
			    me.ix().setSessionOptions(opts, function(ret, ex) {
			    	if (ex) {
			    		asyncResult(ret, ex);
			    	}
			    	else {
			            // Obtain LoginResult with updated UserInfo 
			        	me.refreshLoginResult(asyncResult);
			    	}
			    });
		    }
        	// Synchronous call.
		    else {
		    	me.ix().setSessionOptions(opts);
		    	ret = me.refreshLoginResult();
		    }
        }
        
        return ret; 
    }
    
    /**
     * Update the current user permissions in this connection object.
     * This function calls getSessionFromTicket to receive the current LoginResult object
     * that contains the current permissions and group memberships.
	 * @param asyncResult Asynchronous result object, optional
     * @return LoginResult object with updated permissions and group membership. 
     * @since 20.00.000.003
     */
    this.refreshLoginResult = function(asyncResult) {
    	
    	asyncResult = de.elo.ix.client.makeAsyncResultIfAsyncCallback(asyncResult); 
    	
    	var me = this;
    	var SESSION_FROM_IX = me.getCONST().SESSION_OPTIONS.SESSION_FROM_IX;
    	var ret = null;
    	
    	if (!asyncResult && de.elo.ix.client.createPromise) {
    		ret = me.ix().getSessionOptions()
    				.then(function(sessOpts) {
    					me._auth._fromSessOptsObj(sessOpts);
    				})
    				.then(function(ignored) {
    		    		return me.ix().getSessionFromTicket(SESSION_FROM_IX)
    		    			.then(function(loginResult) {
    		    				me._auth._setLoginResult(loginResult);
    		    				return loginResult;
    		    			});
    				});
    	}
    	else {
		    if (asyncResult) {
		    	
		    	var outerResult = function(sessOpts, ex) {
		    		if (ex) {
		    			asyncResult(null, ex);
		    		}
		    		else {
    					me._auth._fromSessOptsObj(sessOpts);
		    			
    			    	me.ix().getSessionFromTicket(SESSION_FROM_IX, function(loginResult, ex) {
    			    		if (ex == null) {
        			    		me._auth._setLoginResult(loginResult);
    			    		}
    			    		asyncResult(loginResult, ex);
    			    	});
		    		}
		    	}
		    	
		    	me.ix().getSessionOptions(outerResult);
		    }
		    else {
		    	var sessOpts = me.ix().getSessionOptions();
		    	me._auth._fromSessOptsObj(sessOpts);
		    			    	
		    	var loginResult = me.ix().getSessionFromTicket(SESSION_FROM_IX);
		    	me._auth._setLoginResult(loginResult);
		    	
		    	ret = loginResult;
		    }
    	}
    	
    	return ret;
    }

};

