/**
 * <p>
 * This class is used to create IXConnection objects that represent sessions
 * to IndexServer. Use one of the create methods to instanciate an IXConnection 
 * object.
 * </p><p>
 * The connection to the IndexServer is internally hold by an IXClient object. 
 * Its initial parameters are supplied by a Properties collection given in the
 * constructor of IXConnFactory. A reference to the IXClient object is passed
 * to each IXConnection object created by one of the create functions. 
 * </p>
 */
de.elo.ix.client.IXConnFactory = function(url, appName, appVersion) {

	// Pass createPromise function to BYPS
	byps.createPromise = de.elo.ix.client.createPromise;
	
	this.url = url;
	this.computerName = "";
	
	/**
	 * Private function. 
	 * Used to read the Indexserver status page.
	 */
	this._readStatusPageProperty = function() {
        var statusPageProperties = {};
            
		var xhr = new XMLHttpRequest();
		
        var destUrl = this.url + '?cmd=status&mode=text';
		xhr.open("GET", destUrl, false);
		xhr.send(null);
		
		if (xhr.status === 200) {
			
			statusPageProperties = {};
        	
			var responseText = xhr.responseText;
            var lines = responseText.split("\n");
            for (var i=0; i<lines.length; i++) {
            	var line = lines[i];
            	var p = line.indexOf('=');
            	var name = line;
            	var value = "";
            	if (p >= 0) {
            		name = line.substring(0, p);
            		value = line.substring(p+1);
            	}
            	statusPageProperties[name] = value;
            }
		}
		
		return statusPageProperties;
	};
	
	/**
	 * Get the Indexserver version number.
	 */
	this.getVersion = function() {
		var props = this._readStatusPageProperty();
		return props["Version"];
	};
	
	/**
	 * Creates a ClientInfo object and assigns the language, country and timezone
	 * from the default values of the Java VM.
	 * @return ClientInfo object.
	 */
	this.makeDefaultClientInfo = function() {
		var ci = new de.elo.ix.client.ClientInfo();
		ci.timeZone = "UTC";
		if (navigator && navigator.language) {
			ci.language = navigator.language;
		}
		return ci;
	};

	// Pseudo ticket for createFromCookie
	this.TICKET_FROM_COOKIE = "de.elo.ix.client.ticket_from_cookie";

	// Initialize connection properties
	this.PROP_URL = "connection.url";
	this.PROP_TIMEOUT_SECONDS = "connection.timeoutSeconds";
	this.NB_OF_REVERSE_CNNS = "serverR.nbOfCnns";
	this.connProps = {};
	this.connProps[this.PROP_URL] = url;
	this.connProps[this.PROP_TIMEOUT_SECONDS] = 600;
	this.connProps[this.NB_OF_REVERSE_CNNS] = 1;
	
	// Initialize session options
	this.CLIENT_APP_NAME = "clientApp.name";
	this.CLIENT_APP_VERSION = "clientApp.version";
	this.CLIENT_APP_TYPE = "clientApp.type";
	this.TYPE_PARTNER_APPLICATION = "TDBD";
	this.IX_URL_BASE = "ix.ixUrlBase";
	this.DOC_URL_BASE = "ix.documentUrlBase";
	this.SESSION_FROM_AM_ADD = 3;
	this.ENCRYPT_DOCUMENTS = "ix.encryptDocuments";
	this.DECRYPT_DOCUMENTS = "ix.decryptDocuments";
	
	this.sessOpts = {};
	this.sessOpts[this.CLIENT_APP_NAME] = appName || "IXJSON-Application";
	this.sessOpts[this.CLIENT_APP_VERSION] = appVersion || "1.0";
	this.sessOpts[this.CLIENT_APP_TYPE] = this.TYPE_PARTNER_APPLICATION;
	this.sessOpts[this.IX_URL_BASE] = url; 
	this.sessOpts[this.DOC_URL_BASE] = url;
};

/**
 * This class wraps callback functions for asynchronous procession of requests.
 * @param handleSuccess Optional. A function that is called when the response is available and neither an error nor an exception has occured. 
 * 						function(retVal) {}, retval is the returned Indexserver API object.
 * @param handleException Optional. A function that is called when the response is not available but an error or exception has occured.
 * 						function(exVal) {}, exVal is the exception message (String).
 */
de.elo.ix.client.AsyncCallback = function(handleSuccess, handleException) {
	this.handleSuccess = handleSuccess;
	this.handleException = handleException;
};

/**
 * Wrap an AsyncCallback object into an asyncResult function.
 */
de.elo.ix.client.makeAsyncResultIfAsyncCallback = function(asyncResult) {
	
	// EIX-557: To support callback objects in checkoutSord(...sordZ), this function must be in global scope.
	
	if (asyncResult) {
		if (asyncResult.handleSuccess || asyncResult.handleException) {
			// asyncResult is a de.elo.ix.client.AsyncCallback as defined in the old JSON API
			var asyncCallback = asyncResult;
			asyncResult = function(result, ex) {
				if (ex) {
					if (asyncCallback.handleException) {
						asyncCallback.handleException(ex);
					}
				}
				else {
					if (asyncCallback.handleSuccess) {
						asyncCallback.handleSuccess(result);
					}
				}
			};
		}
	}
	return asyncResult;
};

/**
 * Authentication type.
 *
 */
de.elo.ix.client.EAuthenticationType = {
    /**
     * IXConnection created for reading constants.
     * @see IXConnFactory#getCONST() 
     */
    NOT_AUTHENTICATED : 0,
    /**
     * Session created with user name and password.
     * @see IXConnFactory#create(String, String, String, String) 
     */
    NAME_PASSWORD : 1, 
    
    /**
     * Session created with user name and password and run-as-user.
     * @see IXConnFactory#create(String, String, String, String) 
     */
    RUN_AS : 2, 
    /**
     * Session created with user name and password and report-as-user.
     * @see IXConnFactory#createAdmin(String, String, String, String) 
     */
    REPORT_AS : 3,
    /**
     * Session created with SSO.
     * @see IXConnFactory#createSso(String)
     */
    SSO : 4, 
    /**
     * Session create with Kerberos login.
     * @see IXConnFactory#createKrb(ClientInfo, String, String, String, String)
     */
    KERBEROS : 5, 
    /**
     * Session created from a foreign ticket.
     * @see IXConnFactory#createFromTicket(ClientInfo) 
     */
    FROM_TICKET : 6,
    /**
     * Session created from a cookie.
     * @see JSON API function IXConnFactory#createFromCookie(ClientInfo) 
     * @since 11.00.000.044
     */
    FROM_COOKIE : 7 
};

de.elo.ix.client.IXConnFactory.prototype._internalCreateConnection = function(auth, asyncResult) {
	
	var connFact = this;

	var burl = this.url;
	var p = this.url.lastIndexOf("/ix");
	if (p >= 0) {
		burl = burl.substring(0, p) + "/byps";
	}
	
	var wire = new byps.BWireClient(burl);
	
	wire.getUrlForAuthentication = function() {
		var authUrl = this._url;
		var p = authUrl.lastIndexOf('/');
		if (p >= 0) {
			authUrl = authUrl.substring(0, p);
		}
		authUrl += "/bypsauth/auth";
		return authUrl;
	};
	
	var nbOfReverseCnns = connFact.connProps[connFact.NB_OF_REVERSE_CNNS];
	var transportFactory = new byps.BTransportFactory(
			de.elo.ix.client.BApiDescriptor_Indexserver.instance(),
			wire,
			nbOfReverseCnns); 
	
	var bclient = new de.elo.ix.client.BClient_Indexserver(transportFactory);
	bclient.setAuthentication(auth);
	
	// Replace the BTransport.send and BTransport.recv functions with implementations that also accepts an
	// AsyncCallback in parameter asyncResult.
	{
		var transport = bclient.transport;
		
		transport._innerSendMethod = transport.sendMethod;
		transport.sendMethod = function(obj, asyncResult) {
			var innerResult = de.elo.ix.client.makeAsyncResultIfAsyncCallback(asyncResult);
			return transport._innerSendMethod(obj, innerResult);
		};
		
		transport._innerRecvMethod = transport.recv;
		transport.recv = function(server, requestMessage, asyncResult) {
			var innerResult = de.elo.ix.client.makeAsyncResultIfAsyncCallback(asyncResult);
			transport._innerRecvMethod(server, requestMessage, innerResult);
		};
	}
	
	var conn = new de.elo.ix.client.IXConnection(this, bclient, auth, this.url, this.connProps, this.sessOpts);
	
	// Read constants asynchronously
	if (asyncResult) {

		var innerResult = asyncResult;
		
		var outerResult = function(result, exception) {

			if (exception) {
				innerResult(null, exception);
			}
			else {
				var constResult = function(_CONSTANTS, exception2) {
					connFact._CONSTANTS = _CONSTANTS;
					conn._CONSTANTS = _CONSTANTS;
					innerResult(conn, exception2);
				};
				conn.ix().getConstants(constResult);
			}
		};
		
		asyncResult = outerResult;
	}

	// Negotiate, start reverse connection (long-poll)
	bclient.start(asyncResult, false);

	// Read constants synchronously
	if (!asyncResult) {
		if (this._CONSTANTS == null) {
			this._CONSTANTS = conn.getCONST();
		}
		conn._CONSTANTS = this._CONSTANTS; 
	}

	return conn;
};

/**
 * Create a session with the given credentials.
 * @param userName User name
 * @param userPwd User password
 * @param computerName Computer name
 * @param runAs Reserved
 * @param reloginCallback An optional de.elo.ix.client.AsyncCallback object. 
 * When a relogin is performed and succeeds, the reloginCallback.handleSuccess 
 * is called with the de.elo.ix.client.LoginResult. If the relogin fails, the 
 * reloginCallback.handleException is called.
 */
de.elo.ix.client.IXConnFactory.prototype.create = function(userName, userPwd, computerName, runAs, reloginCallback, asyncResult) {
	
	return this.create2(null, userName, userPwd, computerName, runAs, reloginCallback, asyncResult);
};

/**
 * Create a session with the given credentials.
 * @param ci ClientInfo, e.g. set ci.language to specify the language.
 * @param userName User name
 * @param userPwd User password
 * @param computerName Computer name
 * @param runAs Reserved
 * @param reloginCallback An optional de.elo.ix.client.AsyncCallback object that is called, when the framework processes a re-login.
 * 
 * When a relogin is performed and succeeds, the reloginCallback.handleSuccess 
 * is called with the de.elo.ix.client.LoginResult. If the relogin fails, the 
 * reloginCallback.handleException is called.
 */
de.elo.ix.client.IXConnFactory.prototype.create2 = function(ci, userName, userPwd, computerName, runAs, reloginCallback, asyncResult) {
	
	var ret = null;
	var me = this;
	
	if (!asyncResult && de.elo.ix.client.createPromise) {
		var refUserPwd = [userPwd];
		ret = de.elo.ix.client.createPromise(function(resolve, reject) {
			me._internalCreate2(ci, userName, refUserPwd[0], computerName, runAs, reloginCallback, function(result, ex) {
				if (ex) reject(ex); else resolve(result);
			});
			refUserPwd[0] = "";
		});
	}
	else {
		ret = me._internalCreate2(ci, userName, userPwd, computerName, runAs, reloginCallback, asyncResult);
	}

	return ret
};

de.elo.ix.client.IXConnFactory.prototype._internalCreate2 = function(ci, userName, userPwd, computerName, runAs, reloginCallback, asyncResult) {
	
	ci = ci || this.makeDefaultClientInfo();
	computerName = computerName || "";

	if (this.sessOpts[this.CLIENT_APP_TYPE] && computerName) {
		computerName += "\u00B6"+this.sessOpts[this.CLIENT_APP_TYPE];
	}

	asyncResult = de.elo.ix.client.makeAsyncResultIfAsyncCallback(asyncResult);

	var authType = runAs ? de.elo.ix.client.EAuthenticationType.RUN_AS : de.elo.ix.client.EAuthenticationType.NAME_PASSWORD;
		
	var auth = new de.elo.ix.client.IXAuthentication(ci, this.sessOpts, authType);
	
	var refUserPwd = [userPwd];
	
	auth._internalAuthenticate = function(client, asyncResult2) {
		
		var me = this;
		
		if (asyncResult2) {
			
			var methodResult = function(loginResult, exception) {
				if (!exception) {
					me._setLoginResult(loginResult);
				}
				asyncResult2(true, exception);
			};
			
			// EIX-1932: avoid to store plaintext passwords in memory
			if (!me.encrPwd) {
				 me.encrPwd = auth.encryptPassword(refUserPwd[0]);
				 refUserPwd[0] = "";
			}
			
			client.iXServicePortIF.login(userName, me.encrPwd, computerName, runAs, methodResult);
		}
		else {
			
			// EIX-1932: avoid to store plaintext passwords in memory
			if (!me.encrPwd) {
				 me.encrPwd = auth.encryptPassword(refUserPwd[0]);
				 refUserPwd[0] = "";
			}

			var loginResult = client.iXServicePortIF.login(userName, me.encrPwd, computerName, runAs);
			me._setLoginResult(loginResult);
		}
	};
	
	if (reloginCallback) {
		var listener = de.elo.ix.client.makeAsyncResultIfAsyncCallback(reloginCallback);
		auth.addListener(listener);
	}
	
	var conn = this._internalCreateConnection(auth, asyncResult);
	return conn;
};


/**
 * Create a session that uses the HTTP session cookie as authentication token.
 * This session cannot perform an automatic relogin since it does not have the credentials.
 * @param ci ClientInfo object.
 * @param reloginCallback An optional de.elo.ix.client.AsyncCallback object. 
 * When a relogin is performed and succeeds, the reloginCallback.handleSuccess 
 * is called with the de.elo.ix.client.LoginResult. If the relogin fails, the 
 * reloginCallback.handleException is called.
 * @param asyncResult Optional function object that receives the connection. Defined as asyncResult=function(conn, exception) {}. 
 */
de.elo.ix.client.IXConnFactory.prototype.createFromCookie = function(ci, reloginCallback, asyncResult) {
	var ret = null;
	
	// Ensure to have a valid ClientInfo object.
	if (!ci|| !ci._typeId) {
		ci = this.makeDefaultClientInfo();
	}

	// SessionOptionsC.TICKET_FROM_COOKIE is used as ticket.
	// The server replaces this string constant by the ticket mapped in the 
	// server's HTTP session.
	ci.ticket = this.TICKET_FROM_COOKIE;
	
	return this.createFromTicket(ci, reloginCallback, asyncResult);
};


/**
 * Create a session that uses the existing ticket in ci.ticket.
 * This session cannot perform an automatic relogin since it does not have the credentials.
 * @param ci Either ClientInfo object with ticket or the ticket itself.
 * @param reloginCallback An optional de.elo.ix.client.AsyncCallback object. 
 * When a relogin is performed and succeeds, the reloginCallback.handleSuccess 
 * is called with the de.elo.ix.client.LoginResult. If the relogin fails, the 
 * reloginCallback.handleException is called.
 * @param asyncResult Optional function object that receives the connection. Defined as asyncResult=function(conn, exception) {}. 
 */
de.elo.ix.client.IXConnFactory.prototype.createFromTicket = function(ci, reloginCallback, asyncResult) {
	var ret = null;
	var me = this;
	if (!asyncResult && de.elo.ix.client.createPromise) {
		ret = de.elo.ix.client.createPromise(function(resolve, reject) {
			me._internalCreateFromTicket(ci, reloginCallback, function(result, ex) {
				if (ex) reject(ex); else resolve(result);
			});
		});
	}
	else {
		ret = me._internalCreateFromTicket(ci, reloginCallback, asyncResult);
	}
	return ret;
};

de.elo.ix.client.IXConnFactory.prototype._internalCreateFromTicket = function(ci, reloginCallback, asyncResult) {

	var ci1 = this.makeDefaultClientInfo();
	if (ci._typeId) {
		if (!ci.language) ci.language = ci1.language;
		if (!ci.timeZone) ci.timeZone = ci1.timeZone;
		if (!ci.country) ci.country = ci1.country;
	}
	else {
		// Passed something else than a ClientInfo object. 
		// Assume that it is a ticket.
		ci1.ticket = ci;
		ci = ci1;
	}

	asyncResult = de.elo.ix.client.makeAsyncResultIfAsyncCallback(asyncResult); 
	
	// Distinguish between ticket-based and cookie-based IXConnection objects.
	// Cookie-based connections will be logged out in function close()  
	var authType = (ci.ticket == this.TICKET_FROM_COOKIE) ?
			de.elo.ix.client.EAuthenticationType.FROM_COOKIE:
			de.elo.ix.client.EAuthenticationType.FROM_TICKET;
		
	var connFact = this;

	// TTS003873: Pass client application type (SessionOptionsC.CLIENT_APP_TYPE) in creatFromTicket to server.
	// Before this modification, an empty sessionOptions map was passed, because modifying ixUrlBase and docUrlBase 
	// caused side effects in WebClient (absolute, relative URLs). Maybe it is no more necessary to filter this
	// options. Now, all provided options except the url-base options are passed. E.g. it might be useful to update 
	// the application name.
	
	var sessOpts2 = {};
	for (key in connFact.sessOpts) {
		switch (key) {
		case connFact.IX_URL_BASE:
		case connFact.DOC_URL_BASE:
			break;
		default:
			sessOpts2[key] = connFact.sessOpts[key];
			break;
		}
	}
	
	var sessionResult = function(client, asyncResult2) {
		var methodResult = function(loginResult, exception) {
			if (!exception) {
				auth._setLoginResult(loginResult); 
			}
			asyncResult2(true, exception);
		};
		client.iXServicePortIF.getSessionFromTicket(connFact.SESSION_FROM_AM_ADD, methodResult);
	};
	
	var auth = new de.elo.ix.client.IXAuthentication(ci, sessOpts2, authType);
	auth._internalAuthenticate = function(client, asyncResult2) {
		auth.getLoginResult().clientInfo.ticket = ci.ticket;
		sessionResult(client, asyncResult2);
	};
				
	auth._super_isReloginException = auth.isReloginException;
	
	auth.isReloginException = function(client, ex, typeId) {
		if (ex.toString().indexOf("[ELOIX:2001]") >= 0) {
			return false;
		}
		else {
			return this._super_isReloginException(client, ex, typeId);
		}
	};
	
	if (reloginCallback) {
		var listener = de.elo.ix.client.makeAsyncResultIfAsyncCallback(reloginCallback);
		auth.addListener(listener);
	}
	
	var conn = this._internalCreateConnection(auth, asyncResult);
	return conn;
};

/**
 * Create a session that uses the existing ticket in ci.ticket.
 * This session cannot perform an automatic relogin since it does not have the credentials.
 * @param ci ClientInfo object
 * @param reloginCallback An optional de.elo.ix.client.AsyncCallback object. 
 * When a relogin is performed and succeeds, the reloginCallback.handleSuccess 
 * is called with the de.elo.ix.client.LoginResult. If the relogin fails, the 
 * reloginCallback.handleException is called.
 */
de.elo.ix.client.IXConnFactory.prototype.createSSO = function(reloginCallback, asyncResult) {
	var ci = this.makeDefaultClientInfo();
	return this.createSSO2(ci, "", reloginCallback, asyncResult);
};

de.elo.ix.client.IXConnFactory.prototype.createSSO2 = function(clientInfo, computerName, reloginCallback, asyncResult) {
	var ret = null;
	var me = this;
	if (!asyncResult && de.elo.ix.client.createPromise) {
		ret = de.elo.ix.client.createPromise(function(resolve, reject) {
			me._internalCreateSSO2(clientInfo, computerName, reloginCallback, function(result, ex) {
				if (ex) reject(ex); else resolve(result);
			});
		});
	}
	else {
		ret = me._internalCreateSSO2(clientInfo, computerName, reloginCallback, asyncResult);
	}
	return ret;
};

de.elo.ix.client.IXConnFactory.prototype._internalCreateSSO2 = function(clientInfo, computerName, reloginCallback, asyncResult) {

	clientInfo = clientInfo || this.makeDefaultClientInfo();
	computerName = computerName || "";

	if (this.sessOpts[this.CLIENT_APP_TYPE] && computerName) {
		computerName += "\u00B6"+this.sessOpts[this.CLIENT_APP_TYPE];
	}
	
	asyncResult = de.elo.ix.client.makeAsyncResultIfAsyncCallback(asyncResult); 

	var authType = de.elo.ix.client.EAuthenticationType.SSO;
	
	var auth = new de.elo.ix.client.IXAuthentication(clientInfo, this.sessOpts, authType);
	auth._internalAuthenticate = function(client, asyncResult2) {
		
		var auth = this;
		var ci = auth.getLoginResult().clientInfo;
		
		  
		var destUrl = client.transport.wire.getUrlForAuthentication();
		destUrl += "?streamversion=9.00.000.000";
		destUrl += "&responseformat=byps-json";
		destUrl += "&language=" + ci.language;
		destUrl += "&country=" + ci.country;

        // EIX-57: Zeitzone muss escaped werden wg. Schrägstrich. Sicherheitshalber escape auch den Computernamen und die Call-ID. 
		destUrl += "&callid=" + encodeURIComponent(ci.callId);
		destUrl += "&timezone=" + encodeURIComponent(ci.timezone);
		destUrl += "&clientcomputer=" + encodeURIComponent(computerName);
		
        // Sitzungskennung übergeben.
        // Sie wird direkt verworfen und es wird eine neue erstellt. 
        destUrl += "&sessionid=" + client.transport.getSessionId();

        // EIX-393: ggf. kein Ticket zurückgeben.
        // Wenn der Client kein Ticket erhalten soll, dann steht in ci.ticket = SessionOptionsC.TICKET_FROM_COOKIE.
        destUrl += "&ticket=" + ci.ticket;

        var xhr = null;
        if (typeof XDomainRequest != "undefined") {
        	xhr = new XDomainRequest();
        }
        else {
        	xhr = new XMLHttpRequest();
        	if ("withCredentials" in xhr) {
        		xhr.withCredentials = true;
        	}
        }
		
		xhr.open("GET", destUrl, asyncResult != null);
		
		if (asyncResult2) {
			xhr.onreadystatechange = function() {
				if (xhr.readyState != 4) return;
				
				if (xhr.status == 200) {
					
					var bin = client.transport.getInput(xhr.responseText);
					var lr = bin.load();
					
					var targetId = bin.header.targetId;
					var sessionId = bin.header.sessionId;
					if (targetId) {
						client.transport.setTargetId(targetId);
						client.transport.setSessionId(sessionId);
					}
					
					auth._setLoginResult(lr);
					asyncResult2(true, null);
					
				} else {
					var ex = new byps.BException(byps.BExceptionC.IOERROR, "HTTP status " + xhr.status, xhr.responseText);
					asyncResult2(false, ex);
				} 
			};
		}
		
		xhr.send();
		
		if (!asyncResult2) {
			
			if (xhr.status == 200) {
				var bin = client.transport.getInput(xhr.responseText);
				var lr = bin.load();
				
				var targetId = bin.header.targetId;
				var sessionId = bin.header.sessionId;
				if (targetId) {
					client.transport.setTargetId(targetId);
					client.transport.setSessionId(sessionId);
				}
				
				auth._setLoginResult(lr);
			} else {
				throw new byps.BException(byps.BExceptionC.IOERROR, "HTTP status " + xhr.status, xhr.responseText);
			} 
		}
	};
	
	if (reloginCallback) {
		var listener = de.elo.ix.client.makeAsyncResultIfAsyncCallback(reloginCallback);
		auth.addListener(listener);
	}
	
	var conn = this._internalCreateConnection(auth, asyncResult);
	return conn;
};

///////////////////////////////////////////////////////////////////////////////////////////////////////
//
// IXAuthentication
//
///////////////////////////////////////////////////////////////////////////////////////////////////////

de.elo.ix.client.IXAuthentication = function(clientInfo, sessOpts, authType, version) {
	
	this._loginResult = new de.elo.ix.client.LoginResult();
	this._loginResult.clientInfo = clientInfo;
	this._loginResult.user = new de.elo.ix.client.UserInfo();
	  
	this._sessOpts = sessOpts;
	this._encrPasswords = {}; // Map<Integer,String>, <cryptkey, password>
	this._publicKey = null;
	this._serverInfo = {}; // EIX-1932
	this._listeners = []; 
	this._ticketBestBefore = 0;
	this._ticketBestBeforeAlive = 0;
	this._authType = authType;
	this._callId = 0;
	  
	this._RELOGIN_ERRORS = [
		              		  "[ELOIX:2001]", // session expired
		              		];

	  
  this._internalAuthenticate = function(client, asyncResult) {};
	
	// Create Promise that notifies authentication listeners.
	// EIX-1932
  this._notifyListenersP = function(client, ex) {
    var me = this;
    return new Promise(function(resolve, reject) {
      me._notifyListeners(client, ex);
      if (ex) reject(ex);
      else resolve(true);
    });
  };
  
  // Notify authentication listeners synchronously
  // EIX-1932
  this._notifyListenersS = function(client, ex) {
    var me = this;
    me._notifyListeners(client, ex);
  };
  
  // Create promise that calls IX function getServerInfo.
  // EIX-1932
  this._getServerInfoP = function(client) {
    var me = this;
    return new Promise(function(resolve, reject) {
      client.iXServicePortIF.getServerInfo(function(si, ex) {
        if (ex) {
          reject(ex);
        }
        else {
          me._serverInfo = si;
          resolve(si);
        }
      });
    });
  };
  
  // Call IX function getServerInfo synchronously.
  // EIX-1932
  this._getServerInfoS = function(client) {
    this._serverInfo = client.iXServicePortIF.getServerInfo();
  };
  
  // Create Promise that calls IX function login to obtain the public RSA key.
  this._providePublicEncrKeyP = function(client) {
    var me = this;
    return new Promise(function(resolve, reject) {
      client.iXServicePortIF.login("PUBLIC_ENCR_KEY_HEX", null, null, null, function(lr, ex) {
        if (ex) {
          reject(ex);
        }
        else {
          me._publicKeyFromString(lr.clientInfo.ticket);
          resolve(true);
        }
      });
    });
  };
  
  // Synchronously call IX function login to obtain the public RSA key.
  // EIX-1932
  this._providePublicEncrKeyS = function(client) {
    var lr = client.iXServicePortIF.login("PUBLIC_ENCR_KEY_HEX", null, null, null);
    this._publicKeyFromString(lr.clientInfo.ticket);
  };
  
  // Create Promise that calls function internalAuthenticate implemented by sub-classes.
  // EIX-1932
  this._internalAuthenticateP = function(client) {
    var me = this;
    return new Promise(function(resolve, reject) {
      me._internalAuthenticate(client, function(si, ex) {
        if (ex) {
          reject(ex);
        }
        else {
          resolve(true);
        }
      });
    });
  };
  
  // Synchronously call internalAuthenticate.
  // EIX-1932
  this._internalAuthenticateS = function(client) {
    this._internalAuthenticate(client);
  };
  
  // Create Promise that reads the session options from IX.
  // EIX-1932
  this._getSessionOptionsP = function(client) {
    var me = this;
    return new Promise(function(resolve, reject) {
      client.iXServicePortIF.getSessionOptions(function(sessOpts, ex) {
        if (ex) {
          reject(ex);
        }
        else {
        
          for (var i = 0; i < sessOpts.options.length; i++) {
            var kv = sessOpts.options[i];
            if (!me._sessOpts[kv.key]) {
              me._sessOpts[kv.key] = kv.value;
            } 
          }
        
          resolve(sessOpts);
        }
      });
    });
  };
  
  // Synchronously read session options from IX:
  // EIX-1932
  this._getSessionOptionsS = function(client) {
    var me = this;
    var sessOpts = client.iXServicePortIF.getSessionOptions();
    for (var i = 0; i < sessOpts.options.length; i++) {
      var kv = sessOpts.options[i];
      if (!me._sessOpts[kv.key]) {
        me._sessOpts[kv.key] = kv.value;
      } 
    }
  };
  
  // Create Promise to set session options in IX.
  // EIX-1932
  this._setSessionOptionsP = function(client) {
    var me = this;
    return new Promise(function(resolve, reject) {
    
      var opts = me._makeSessOptsObj();
    
      client.iXServicePortIF.setSessionOptions(opts, function(ignored, ex) {
        if (ex) {
          reject(ex);
        }
        else {
          resolve(true);
        }
      });
    });
  };
  
  // Set session options in IX.
  // EIX-1932
  this._setSessionOptionsS = function(client) {
    var me = this;
    var opts = me._makeSessOptsObj();
    client.iXServicePortIF.setSessionOptions(opts);
  };
  
  // Create Promise to provide an encryption password.
  // EIX-1932
  this._provideCryptPasswordP = function(client, cryptId, pwdEncr) {
    var me = this;
    return new Promise(function(resolve, reject) {
      client.iXServicePortIF.provideCryptPassword(cryptId, pwdEncr, function(ignored, ex) {
        if (ex) {
          reject(ex);
        }
        else {
          resolve(true);
        }
      });
    });
  };
  
  // Send password for document encryption to IX.
  // EIX-1932
  this._provideCryptPasswordS = function(client, cryptId, pwdEncr) {
    client.iXServicePortIF.provideCryptPassword(cryptId, pwdEncr);
  };
  
  // Create Promise to send all currently entered encryption passwords to IX.
  // EIX-1932
  this._provideCryptPasswordsP = function(client) {
    var me = this;
    var ret = new Promise(function(resolve, reject) {
      resolve(true);
    });
    
    for (var cryptId in me._encrPasswords) {
      ret = ret.then(me._provideCryptPasswordP(client, cryptId, me._encrPasswords[cryptId]));
    }
    
    return ret;
  };
  
  // Send currently entered encryption passwords to IX.
  // EIX-1932
  this._provideCryptPasswordsS = function(client) {
    var me = this;
    for (var cryptId in me._encrPasswords) {
      me._provideCryptPasswordS(client, cryptId, me._encrPasswords[cryptId]);
    }
  };
  
  this.getLoginResult = function() { 
	  return this._loginResult; 
  };
	  
  this.authenticate = function(client, asyncResult, processAsync) {
  
    // EIX-1932: Use Promise objects to simplify program flow.
  
    var me = this;
    if (processAsync) {
    
  	  me._getServerInfoP(client)
  	   .then(ignored => me._providePublicEncrKeyP(client))
  	   .then(ignored => me._internalAuthenticateP(client))
  	   .then(ignored => me._getSessionOptionsP(client))
  	   .then(ignored => me._setSessionOptionsP(client))
  	   .then(ignored => me._provideCryptPasswordsP(client))
  	   .then(ignored => me._notifyListenersP(client, null), ex => me._notifyListenersP(client, ex))
  	   .then(ignored => asyncResult(true, null), ex => asyncResult(false, ex));
  	   
	  }
	  else {
	    try {
  	    me._getServerInfoS(client);
  	    me._providePublicEncrKeyS(client);
  	    me._internalAuthenticateS(client);
  	    me._getSessionOptionsS(client);
  	    me._setSessionOptionsS(client);
  	    me._provideCryptPasswordsS(client);
  	    me._notifyListenersS(client, null);
  	    asyncResult(true, null);
  	  }
  	  catch (ex) {
  	    me._notifyListenersS(client, ex);
  	    asyncResult(false, ex);
  	  }
	  }
  };
	  
	  this.getSession = function(client, typeId, asyncResult) {
		  this._loginResult.clientInfo.callId = "JSON-" + (++this._callId);
		  
		  if (asyncResult) {
			  if (this.needAlive()) {

				  this._ticketBestBeforeAlive = 0; // damit needAlive() das nächste mal false zurückgibt
				  
				  var auth = this;
				  client.iXServicePortIF.alive(function(ignored, ex) {
					  if (!ex) {
						  auth._setTicketValid();
					  }
					  asyncResult(auth._loginResult.clientInfo, ex);
				  });
			  }
			  else {
				  
				  asyncResult(this._loginResult.clientInfo, null);
			  }
		  }
		  else {
			  if (this.needAlive()) {
				  this._ticketBestBeforeAlive = 0;
				  client.iXServicePortIF.alive();
				  this._setTicketValid();
			  }
		  }
		  
		  return this._loginResult.clientInfo;
	  };
	  
	  this.isReloginException = function(client, ex, typeId) { 
		  
		  var typeId_BRequest_IXServicePortIF_sendEvents = 1721831543;
		  var typeId_BRequest_IXServicePortIF_createEventBusListener = 563568172;
		  
		  if (typeId == typeId_BRequest_IXServicePortIF_sendEvents || typeId == typeId_BRequest_IXServicePortIF_createEventBusListener) {
			  return false;
		  }
		  
		  var msg = "" + ex; 
		  
		  if (client.transport.isReloginException(ex, 0)) return true;
		  
		  for (var i = 0; i < this._RELOGIN_ERRORS.length; i++) {
			  var errorCode = this._RELOGIN_ERRORS[i];
			  if (msg.indexOf(errorCode) >= 0) return true;
		  }
		  
		  return false; 
	  };
	  
};

de.elo.ix.client.IXAuthentication.prototype._makeSessOptsObj = function() {
	var opts = new de.elo.ix.client.SessionOptions();
	var kvs = opts.options = [];
	var i = 0;
	for (var k in this._sessOpts) {
		var kv = kvs[i++] = new de.elo.ix.client.KeyValue();
		kv.key = k;
		kv.value = this._sessOpts[kv.key];
	}
	return opts;
};

/**
 * Store provided SessionOptions object in current session options.
 * This function does not send the options to IX.
 * @param opts SessionOptions object.
 */
de.elo.ix.client.IXAuthentication.prototype._fromSessOptsObj = function(opts) {
	this._sessOpts = {};
	for (var i = 0; i < opts.options.length; i++) {
		var kv = opts.options[i];
		this._sessOpts[kv.key] = kv.value;
	}
};

de.elo.ix.client.IXAuthentication.prototype._publicKeyFromString = function(rsaKeysHex) {
	
    // Create an object of Tom Wu's RSA class 
    var p = rsaKeysHex.indexOf(" ");
    var mod = rsaKeysHex.substr(0, p);
    var exp = rsaKeysHex.substr(p+1); 
    this._publicKey = new RSAKey();
    this._publicKey.setPublic(mod, exp);
    
};

de.elo.ix.client.IXAuthentication.prototype.encryptPassword = function(pwd) {

    // EIX-1932: new method of password encryption.
    var version = this._serverInfo.version;
	  var newPasswordEncryption = (version.localeCompare("20.06") >= 0 && version.localeCompare("21") < 0) || version.localeCompare("21.02") >= 0;
    if (newPasswordEncryption) {
      pwd = Math.random() + " " + pwd;
    }
	
    // Encrypt password
    var res = this._publicKey.encrypt(pwd);
    
    // encode with BASE64
    var base64 = hex2b64(res);
    
    if (!newPasswordEncryption) {
      pwd = "##RSA##" + pwd;
    }
    
    // return encrypted password
    return base64;
};

de.elo.ix.client.IXAuthentication.prototype._setLoginResult = function(loginResult) {
	if (loginResult) {
		this._loginResult = loginResult;
		this._setTicketValid();
	}
};

de.elo.ix.client.IXAuthentication.prototype._setTicketValid = function() {
	var now = (new Date()).getTime();
	this._ticketBestBefore = now + (this._loginResult.ticketLifetime * 1000);
	this._ticketBestBeforeAlive = now + (this._loginResult.ticketLifetime * 500);
};

de.elo.ix.client.IXAuthentication.prototype.isExpried = function() {
	var now = (new Date()).getTime();
	return this._ticketBestBefore < now;
};

de.elo.ix.client.IXAuthentication.prototype.needAlive = function() {
	var now = (new Date()).getTime();
	return this._ticketBestBefore >= now && this._ticketBestBefore && this._ticketBestBefore < now;
};

de.elo.ix.client.IXAuthentication.prototype.addListener = function(listener) {
	this._listeners.push(listener);
};

de.elo.ix.client.IXAuthentication.prototype.removeListener = function(listener) {
	for (var i = 0; i < this._listeners.length; i++) {
		if (this._listeners[i] === listener) {
			delete this._listeners[i];
			break;
		}
	}
};

de.elo.ix.client.IXAuthentication.prototype._notifyListeners = function(client, exception) {
	for (var i = 0; i < this._listeners.length; i++) {
		var l = this._listeners[i];
		l(this._loginResult, exception); // EIX-73: TypeError in IXConnFactory.create, if relogin callback was supplied. 
	}
};

de.elo.ix.client.IXAuthentication.prototype.isExpired = function() {
	return this._ticketBestBefore < new Date().getTime();
};

/**
 * Create the interface object, if it does not exist.
 */
de.elo.ix.client.BStub_IXServicePortIF = de.elo.ix.client.BStub_IXServicePortIF || {};

/**
 * Override checkoutSord to support both EditInfo and Sord.
 *  
 * @param objId Object-ID
 * @param sordZOrEditInfoZ Either a de.elo.ix.client.SordZ or a de.elo.ix.client.EditInfoZ.
 * @param lockZ Lock mode.
 * @param asyncResult Optional. Object of class de.elo.ix.client.AsyncCallback.
 * @return If parameter sordZOrEditInfoZ contains a de.elo.ix.client.SordZ, the function returns a Sord object.
 * If parameter sordZOrEditInfoZ contains a de.elo.ix.client.EditInfoZ, the function returns a EditInfo object.  
 */
de.elo.ix.client.BStub_IXServicePortIF.prototype.internalCheckoutSord = de.elo.ix.client.BStub_IXServicePortIF.prototype.checkoutSord; 
de.elo.ix.client.BStub_IXServicePortIF.prototype.checkoutSord = function(objId, sordZOrEditInfoZ, lockZ, asyncResult) {
	var ret = null;
	var me = this;
	if (!asyncResult && de.elo.ix.client.createPromise) {
		ret = de.elo.ix.client.createPromise(function(resolve, reject) {
			me._internalCheckoutSordForSordZOrEditZ(objId, sordZOrEditInfoZ, lockZ, function(result, ex) {
				if (ex) reject(ex); else resolve(result);
			});
		});
	}
	else {
		ret = me._internalCheckoutSordForSordZOrEditZ(objId, sordZOrEditInfoZ, lockZ, asyncResult);
	}
	return ret;
};

de.elo.ix.client.BStub_IXServicePortIF.prototype._internalCheckoutSordForSordZOrEditZ = function(objId, sordZOrEditInfoZ, lockZ, asyncResult) {
  
  var editInfoZ = sordZOrEditInfoZ;
  var isSordZ = sordZOrEditInfoZ && sordZOrEditInfoZ._typeId == (new de.elo.ix.client.SordZ())._typeId;
  
  var outerResult = asyncResult;
  
  if (isSordZ) {
	editInfoZ = new de.elo.ix.client.EditInfoZ();
	editInfoZ.sordZ = sordZOrEditInfoZ;
	
	if (asyncResult) {
		var innerResult = de.elo.ix.client.makeAsyncResultIfAsyncCallback(asyncResult);
		outerResult = function(ed, ex) {
			var sord = ex ? null : ed.sord;
			innerResult(sord, ex);
		}
	}
  }
  
  var ret = this.internalCheckoutSord(objId, editInfoZ, lockZ, outerResult);
  
  return (!outerResult && isSordZ) ? ret.sord : ret;
};

/**
 * Override checkoutSord to support both EditInfo and Sord.
 * 
 * @param parentId ID of parent entry.
 * @param maskId ID or name of keywording form.
 * @param sordZOrEditInfoZ Elements to be returned. Either a de.elo.ix.client.SordZ or a de.elo.ix.client.EditInfoZ.
 * @param asyncResult Optional. Object of class de.elo.ix.client.AsyncCallback.
 * @return If parameter sordZOrEditInfoZ contains a de.elo.ix.client.SordZ, the function returns a Sord object.
 * If parameter sordZOrEditInfoZ contains a de.elo.ix.client.EditInfoZ, the function returns a EditInfo object.  
 */
de.elo.ix.client.BStub_IXServicePortIF.prototype.internalCreateSord = de.elo.ix.client.BStub_IXServicePortIF.prototype.createSord;
de.elo.ix.client.BStub_IXServicePortIF.prototype.createSord = function(parentId, maskId, sordZOrEditInfoZ, asyncResult) {
	var ret = null;
	var me = this;
	if (!asyncResult && de.elo.ix.client.createPromise) {
		ret = de.elo.ix.client.createPromise(function(resolve, reject) {
			me._internalCreateSordForSordZOrEditZ(parentId, maskId, sordZOrEditInfoZ, function(result, ex) {
				if (ex) reject(ex); else resolve(result);
			});
		});
	}
	else {
		ret = me._internalCreateSordForSordZOrEditZ(parentId, maskId, sordZOrEditInfoZ, asyncResult);
	}
	return ret;
};

de.elo.ix.client.BStub_IXServicePortIF.prototype._internalCreateSordForSordZOrEditZ = function(parentId, maskId, sordZOrEditInfoZ, asyncResult) {
  var editInfoZ = sordZOrEditInfoZ;
  var isSordZ = sordZOrEditInfoZ && sordZOrEditInfoZ._typeId == (new de.elo.ix.client.SordZ())._typeId;
	  
  var outerResult = asyncResult;
  
  if (isSordZ) {
    editInfoZ = new de.elo.ix.client.EditInfoZ();
    editInfoZ.sordZ = sordZOrEditInfoZ;

    if (asyncResult) {
    	var innerResult = de.elo.ix.client.makeAsyncResultIfAsyncCallback(asyncResult);
		outerResult = function(ed, ex) {
			var sord = ex ? null : ed.sord;
			innerResult(sord, ex);
		}
	}
  }
	  
  var ret = this.internalCreateSord(parentId, maskId, editInfoZ, outerResult);
	  
  return (!outerResult && isSordZ) ? ret.sord : ret;
};

	
	
